import React from "react";
import "./NavBar.css";
import { NavLink } from "react-router-dom";
import { useIsAuthenticated, useAuthUser } from "react-auth-kit";

const NavigationBar = () => {
  const authUser = useAuthUser();
  const isAuthenticated = useIsAuthenticated();
  return (
    <div className="navbar">
      <ul className="nav-links">
        <li>
          <NavLink
            to="/"
            className={({ isActive }) => (isActive ? "active" : undefined)}
            end
          >
            Home
          </NavLink>
        </li>
        {!isAuthenticated() && (
          <li>
            <NavLink
              to="/login"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Login
            </NavLink>
          </li>
        )}
        {!isAuthenticated() && (
          <li>
            <NavLink
              to="register"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Register
            </NavLink>
          </li>
        )}
        {!isAuthenticated() && (
          <li>
            <NavLink
              to="contact"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Contact
            </NavLink>
          </li>
        )}

        {!isAuthenticated() && (
          <li>
            <NavLink
              to="about"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              About
            </NavLink>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <NavLink
              to="presentation"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              New Lecture
            </NavLink>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <NavLink
              to="activePresentations"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Active Lectures
            </NavLink>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <NavLink
              to="joinALecture"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              Join a Lecture
            </NavLink>
          </li>
        )}

        {isAuthenticated() && (
          <li>
            <NavLink
              to="signOut"
              className={({ isActive }) => (isActive ? "active" : undefined)}
            >
              SignOut
            </NavLink>
          </li>
        )}
      </ul>
      {isAuthenticated() && (
        <div className="user-greeting">Hello {authUser().firstName}</div>
      )}
    </div>
  );
};

export default NavigationBar;
